import React from "react";
import Scroll from 'react-scroll';

import "./Navbar.css"
const Navbar = (props)=>{
    return (
        <div className="ctn-navbar">
            <div className="logo-ctn">
                <img src={"logo.svg"} className='logo-navbar'/>
            </div>
            <div className="links-ctn">
                <a href="" onClick={toPropostio}>PROPÓSITO</a>
                <a href="" onClick={toComoFunciona}>COMO FUNCIONA</a>
                <a href="" className="yellow-text" onClick={toConhecaOApp}>CONHEÇA O APP</a>
            </div>
        </div>
    )
}

export default Navbar;
